import styled from "styled-components";

const Header = styled.header`
  width: 100%;
  height: 80px;
  padding: 0px 18px;

  display: flex;
  align-items: center;
  justify-content: space-between;

  position: fixed;
  left: 0px;
  top: 0px;
  z-index: 1;

  font-size: 26px;

`;

export default Header;
